import React from 'react'
import { useTheme } from '@material-ui/core/styles';
import { CarasouleImageStyles } from '../styles/muiStyles';
import Carousel from 'better-react-carousel'

export default function CarasoleImage() {
    const classes = CarasouleImageStyles();
  return (
    <div className={classes.imageWrapper}>
     <Carousel className={classes.image} cols={1} rows={1} gap={10} loop>
      <Carousel.Item className={classes.image}>
        <img className={classes.image} height='10%' width="100%" src="https://picsum.photos/800/600?random=1" />
      </Carousel.Item>
      <Carousel.Item className={classes.image}>
        <img width="100%" src="https://picsum.photos/800/600?random=2" />
      </Carousel.Item >
     
     
      </Carousel>
    </div>
  );
}
